GET requests query operation type (optional) + name(optional) + data structure + arguments(optional) query myGETExampleName { getProduct(id: 123){ name description }
} POST/PUT/DELETE requests GraphQL Mutations same as QUERIES, but they take some input (inline/variable) mutation exampleMutationName{ createProduct(name: "TEST", listed:"yes"){ id name listed }
} GraphQL variables Taken from a JSON-based VARIABLES dictionary Steps to use variables Declare in the query header (after the name) - $id: ID!, ! - required Use the declared value in the query as argument - id:$id Declare the variable value in the Variables dictionary query myGETExampleName ($id: ID!) { getProduct(id: $id){ name description }
} Variables:
{ "id": 1
} Aliases GraphQL objects can't contain the same property/object twice Use ALIASES to return the same object with different arguments This can allow you to basiucally send multiple GraphQL messages in one HTTP request #Valid query using aliases query getProductDetails { product1: getProduct(id: "1") { id name } product2: getProduct(id: "2") { id name }
} Fragments reusable parts of queries or mutations reusable object / field grouping can be included then in queries with ... preceding it # Example fragment
fragment fragmentName on Product{ id name listed
